    <style>
      body {
        margin: 0;
        padding: 0;
        overflow: hidden;
        background: #ffffff;
        font-family: Roboto;
        color: #000000;
      }
      .container-box {
        margin: 8px 16px 8px 16px;
        padding: 12px;
        border-radius: 16px;
        line-height: 0.95;
        width: fit-content;
        height: fit-content;
        z-index: 2;
        backdrop-filter: blur(3px);
        background: #ffffffaa;
        box-shadow: 2px 3px 10px #aaaaaa44;
        position: relative;
        pointer-events: auto;
      }
      .more-opaque {
        backdrop-filter: blur(6px);
        background-color: #ffffffee;
      }
      #deck-container {
        width: 100vw;
        height: 100vh;  
      }
      #deck-container canvas {
        z-index: 1;
        background: #ffffff;
      }
      .deck-tooltip {
          
            font-size: 0.8em;
            font-family: Roboto;
            font-weight: 300;
            color: #000000 !important;
            background-color: #ffffffee !important;
            border-radius: 12px;
            backdrop-filter: blur(6px);
            box-shadow: 2px 3px 10px #aaaaaa44;
            max-width: 25%;
      }
      input {
        margin: 2px;
        padding: 4px;
        border-radius: 8px;
        color: #000000;
        background: #ffffffdd;
        border: 2px inset #77777744;
        transition: 0.5s;
        outline: none;
        box-sizing: border-box;
      }
      input:focus {
        border: 2px inset #555;
      }
    </style>
  
<!-- Import fonts to match website -->
<link href="https://fonts.googleapis.com/css2?family=Inter:wght@300;400;500;600;700&display=swap" rel="stylesheet">

<style>
/* Apply Inter font globally with Verdana fallback */
* {
  font-family: "Inter", Verdana, sans-serif !important;
}
body, text, tspan, .annotation-text, .plotly .annotation-text,
.datamap-label, .datamap-tooltip, .tooltip-text {
  font-family: "Inter", Verdana, sans-serif !important;
}
/* Search box styling to match website */
#text-search {
  font-family: "Inter", Verdana, sans-serif !important;
}
/* DataMapPlot specific hover/tooltip styling */
.datamap-tooltip, .datamap-hover, .hover-tooltip,
.tooltip, .tooltip-text, .hover-text, .hoverinfo,
div[role="tooltip"], .hoverlabel, .hovertext {
  font-family: "Inter", Verdana, sans-serif !important;
  font-size: 14px !important;
  line-height: 1.6 !important;
  white-space: pre-line !important;
}
/* Legend and labels */
.legend text, .xaxislayer-above text, .yaxislayer-above text,
.colorbar text, .js-plotly-plot text, .datamap-legend text,
.topic-label, .cluster-label {
  font-family: "Inter", Verdana, sans-serif !important;
}
/* Topic labels on the map - comprehensive targeting */
.datamap-label text, .topic-annotation text,
text.annotation-text, .annotation text,
g.annotation text, g.annotations text,
.plotly .annotation text, .js-plotly-plot .annotation text,
svg text.annotation-text, svg g.annotation-text-g text,
g[class*="annotation"] text, text[class*="annotation"],
.main-svg text, .plotly-graph-div text,
text[data-unformatted*=""], text[style*="font-family"],
.infolayer text, .layer-above text {
  font-family: "Inter", Verdana, sans-serif !important;
  font-weight: 500 !important;
}
/* Override any inline font-family styles */
text[style*="font-family"] {
  font-family: "Inter", Verdana, sans-serif !important;
}
/* Target Plotly annotations specifically */
.plotly .textpoint, .plotly .textpoint text,
.plotly g.annotation, .plotly g.annotation text,
.annotation-text-g text, g.annotation-text-g text {
  font-family: "Inter", Verdana, sans-serif !important;
}
/* Make grey/outlier dots extremely light - almost invisible */
.datamap-point[data-topic="-1"] {
  fill: #fafafa !important;
  opacity: 0.15 !important;
  stroke: none !important;
}
/* Also target any grey colored points - make them extremely light */
.datamap-point[style*="rgb(128, 128, 128)"],
.datamap-point[style*="#808080"],
.datamap-point[style*="gray"],
.datamap-point[style*="grey"],
circle[fill="#808080"],
circle[fill="rgb(128, 128, 128)"],
circle[fill="gray"],
circle[fill="grey"] {
  fill: #f8f8f8 !important;
  opacity: 0.1 !important;
  stroke: none !important;
}
/* Target SVG circles that might be grey */
circle[style*="fill: rgb(128, 128, 128)"],
circle[style*="fill:#808080"] {
  fill: #f8f8f8 !important;
  opacity: 0.1 !important;
  stroke: none !important;
}
/* Make outlier points smaller */
.datamap-point[data-topic="-1"],
circle[fill="#808080"],
circle[fill="rgb(128, 128, 128)"] {
  r: 2 !important;
  stroke-width: 0 !important;
}
/* Default zoom level - zoom in closer */
canvas, svg {
  transform-origin: center center;
  transform: scale(1.8) !important;
}
#plotly-div, .plotly-graph-div {
  overflow: visible !important;
}
</style>

            result.set(arr, currentLength);

    // Blob for the parsing worker
    const parsingWorkerBlob = new Blob([`
      self.onmessage = async function(event) {
      const { encodedData, JSONParse } = event.data;
        // Function to parse base64 to Uint8Array
        async function DecompressBytes(bytes) {
          const blob = new Blob([bytes]);
          const decompressedStream = blob.stream().pipeThrough(
            new DecompressionStream("gzip")
          );
          const arr = await new Response(decompressedStream).arrayBuffer()
          return new Uint8Array(arr);
        }
        async function decodeBase64WithProgress(base64) {
          const totalLength = base64.length;
          const chunkSize = 1024 * 1024; // 1MB chunks
          let decodedArray = new Uint8Array(Math.ceil(totalLength * 3 / 4));
          let offset = 0;

          for (let i = 0; i < totalLength; i += chunkSize) {
            const chunk = base64.slice(i, i + chunkSize);
            const decodedChunk = Uint8Array.from(atob(chunk), c => c.charCodeAt(0));
            decodedArray.set(decodedChunk, offset);
            offset += decodedChunk.length;

            const progress = Math.min(100, Math.round((i + chunkSize) / totalLength * 100));
            self.postMessage({ type: 'progress', progress: progress });

            // Allow other operations to occur
            await new Promise(resolve => setTimeout(resolve, 0));
          }

          return decodedArray.slice(0, offset);
        }
        const binaryData = await decodeBase64WithProgress(encodedData).then(buffer => DecompressBytes(buffer));

        if (JSONParse) {
          const parsedData = JSON.parse(new TextDecoder("utf-8").decode(binaryData));
          self.postMessage({ data: parsedData });
        } else {
          // Send the parsed table back to the main thread
          self.postMessage({ type: "data", data: binaryData });
        }
      }
    `], { type: 'application/javascript' });

    const histogramItemId = "d3histogram-container";
    const selectionItemId = "lasso-select";
    const searchItem = document.getElementById(searchItemId);
    let histogramItem = null;
    
    const container = document.getElementById('deck-container');

    const labelDataWorker = new Worker(workerUrl);
    const pointDataWorker = new Worker(workerUrl);
    const metaDataWorker = new Worker(workerUrl);
    

    const datamap = new DataMap({
      container: container,
      bounds: [-13.129834098815918, 15.610672874450684, -14.464441032409669, 15.535559387207032],
      searchItemId: searchItemId,
      lassoSelectionItemId: selectionItemId,      
    });
window.datamap = datamap;

    function updateProgressBar(id, progress) {
      const progressBar = document.querySelector(`#${id} .datamapplot-progress-bar-fill`);
      const progressText = document.querySelector(`#${id} .datamapplot-progress-bar-text`);
      progressBar.style.width = `${progress}%`;
      progressText.textContent = `${id.replace('-progress', '').replace(/-/g, ' ').replace(/\b\w/g, l => l.toUpperCase())}: ${progress}%`;
    }

    function checkAllDataLoaded() {
      const progressBars = document.querySelectorAll('.datamapplot-progress-bar-fill');
      const allLoaded = Array.from(progressBars).every(bar => bar.style.width === '100%');
      if (allLoaded) {
        document.getElementById("loading").style.display = "none";
        document.getElementById("progress-container").style.display = "none";
      }
    }

    function loadPointDataLayer() {
      pointDataWorker.postMessage({encodedData: pointDataEncoded, JSONParse: false});

      pointDataWorker.onmessage = async function(event) {
        if (event.data.type === "progress") {
          updateProgressBar('point-data-progress', event.data.progress);
        } else {
          const { data } = event.data;
          
          const pointData = await simpleArrowParser(data);
          
          datamap.addPoints(
            pointData,
            {
              pointSize: 0.06712750568386232,
              pointOutlineColor: [250, 250, 250, 128],
              pointLineWidth: 0.001,
              pointHoverColor: [170, 0, 0, 187],
              pointLineWidthMaxPixels: 3,
              pointLineWidthMinPixels: 0.001,
              pointRadiusMaxPixels: 24,
              pointRadiusMinPixels: 0.01,
            }
          );

          document.getElementById("loading").style.display = "none";
          updateProgressBar('point-data-progress', 100);
          checkAllDataLoaded();}
      };

      
    }

    function loadLabelDataLayer() {
      labelDataWorker.postMessage({encodedData: labelDataEncoded, JSONParse: true});

      labelDataWorker.onmessage = async function(event) {
        if (event.data.type === "progress") {
          updateProgressBar('label-data-progress', event.data.progress);
        } else {
          const { data } = event.data;
          const labelData = data;
          datamap.labelData = labelData;
          // Only build labels where we have a position.
          datamap.addLabels(labelData, {
            labelTextColor: d => [d.r, d.g, d.b],
            textMinPixelSize: 18,
            textMaxPixelSize: 36,
            textOutlineWidth: 8,

          updateProgressBar('label-data-progress', 100);
          checkAllDataLoaded();
        }
      };
    }

    function loadMetaData() {
      metaDataWorker.postMessage({encodedData: hoverDataEncoded, JSONParse: true});

      metaDataWorker.onmessage = async function(event) {
        if (event.data.type === "progress") {
          updateProgressBar('meta-data-progress', event.data.progress);
        } else {
          const { data } = event.data;
          const hoverData = data;
          datamap.addMetaData(hoverData, {
            tooltipFunction: ({index}) => hoverData.hover_text[index],
            onClickFunction: null,
            searchField: "hover_text",
          });

          updateProgressBar('meta-data-progress', 100);
          checkAllDataLoaded();
        }
      };
    }

    loadPointDataLayer();
